// src\components\About.js

import React from 'react';
import styled from 'styled-components';

const AboutWrapper = styled.div`
  padding: 2rem;
  text-align: center;
`;

function About() {
  return (
    <AboutWrapper>
      <h1>About Me</h1>
      <p>Detailed bio, your journey, and what you are passionate about.</p>
      <p>Link to resume.</p>
    </AboutWrapper>
  );
}

export default About;
